const linkStyle = {
    marginRight: 15
};

const Index = () => (
    <div>
        <h1>Links</h1>
        <ul>
            <li>
                <Link href="/">
                    <a title="Home" style={linkStyle}>Home</a>
                </Link>
            </li>
            <li>
                <Link href="/about">
                    <a title="About" style={linkStyle}>About</a>
                </Link>
            </li>
        </ul>


        <p>Hello Next.js</p>
    </div>
  );

  export default Index;
